  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Waubay Wetland
  Management District outlines district accomplishments during the 1980 calendar year.
  The report begins with an introduction to the Refuge and information about weather
  conditions, habitat conditions, and the system status. Construction, maintenance,
  and wildfires are also described. Habitat management is covered; croplands, grasslands,
  wetlands, and forests are discussed. The wildlife section of the report discusses
  endangered and threatened species, migratory birds, and mammals. Interpretation
  and recreation activities are outlined; topics include information and interpretation,
  recreation, and law enforcement. Field investigations, cooperative programs, items
  of interest, and safety information are attached.\",\n\t\"license_title\": \"License
